import React from "react";
import MUIDataTable from "mui-datatables";

const columns = ["ID", "First", "Last"];
const data = [];
for (let i = 1; i <= 500; i++) {
  data.push({
    id: `${i}`,
    First: `User${i} First`,
    Last: `User${i} Last`,
  });
}

const options = {
  pagination: false,
};

export default function Table(props) {
  return (
    <MUIDataTable
      title={"Employee List"}
      data={data}
      columns={columns}
      options={options}
    />
  );
}
